import React from 'react';
import { NavLink } from 'react-router-dom';


const Nav = ({match}) => (

    <nav className="main-nav">
        <ul>
          <li><NavLink to={`${match.url}/ocean`}>Ocean</NavLink></li>
          <li><NavLink to={`${match.url}/river`}>River</NavLink></li>
          <li><NavLink to={`${match.url}/ocean`}>Lake</NavLink></li>
        </ul>
     </nav>

);

export default Nav;  

